import React, { Component } from 'react'

export default class Score extends Component {
    render() {
        return (
            <div>
                    <tr>
      <td>{props.date}</td>
      <td>{props.description}</td>
      <td>{props.category}</td>
      <td>{props.amount}</td>
            </tr>
            </div>
        )
    }
}
